CREATE DATABASE IF NOT EXISTS CLUB_MS;
USE CLUB_MS;
show tables;

CREATE TABLE students (
ROLL_NO INT PRIMARY KEY CHECK (ROLL_NO>0),
EMAIL VARCHAR(255) NOT NULL UNIQUE,
CONTACT_NO BIGINT UNIQUE CHECK (CONTACT_NO > 999999999 AND CONTACT_NO < 10000000000),
FIRST_NAME VARCHAR(20)NOT NULL,
MIDDLE_NAME VARCHAR(20),
LAST_NAME VARCHAR(20),
STREET VARCHAR(30),
CITY VARCHAR(30)NOT NULL,
STATE VARCHAR(30)NOT NULL,
PINCODE INT NOT NULL CHECK (PINCODE>99999 and PINCODE <1000000),
DATE_OF_BIRTH DATE NOT NULL,
AGE INT CHECK(AGE >0)NOT NULL,
PROGRAMME VARCHAR(10) NOT NULL CHECK (PROGRAMME IN('BTECH','MTECH','MSc','MA')),
DISCIPLINE VARCHAR(20) NOT NULL,
YEAR YEAR NOT NULL,
CONSTRAINT CheckEmailFormatStudents CHECK (EMAIL LIKE '%@%.%')
);


CREATE TABLE employee (
EMPLOYEE_ID INT PRIMARY KEY CHECK (EMPLOYEE_ID>0),
EMAIL VARCHAR(255) NOT NULL UNIQUE,
CONSTRAINT CheckEmailFormatEmployee CHECK (EMAIL LIKE '%@%.%'),
FIRST_NAME VARCHAR(20)NOT NULL,
MIDDLE_NAME VARCHAR(20),
LAST_NAME VARCHAR(20),
DEPARTMENT VARCHAR(20),
DESIGNATION VARCHAR(25) CHECK (DESIGNATION IN('PROFFESSOR','ASSISTANT PROFFESSOR','VISITING PROFFESSOR','WARDEN','CARETAKER','STUDENT AFFAIRS STAFF','HOSTEL OFFICE STAFF'))
);

-- FACILITIES IS OF JSON TYPE MEANING IT WILL HAVE AN ARRAY/LIST OF VALUES. FOR EXAMPLE : ['SPEAKER':1, 'TV' :1,'AC':1,'FAN':0]  

CREATE TABLE venue(
ADDRESS VARCHAR(30) PRIMARY KEY,
CAPACITY INT,
AVAILABILITY BOOLEAN NOT NULL,
FACILITIES JSON NOT NULL
);

CREATE TABLE EVENT(
EVENT_NAME VARCHAR(20),
EDITION INT CHECK(EDITION>0),
MODE_OF_CONDUCT VARCHAR(10) NOT NULL,
DESCRIPTION VARCHAR (200) NOT NULL,
PARTICIPATION_FORM VARCHAR(400) UNIQUE NOT NULL,
RULEBOOK_LINK VARCHAR(400) UNIQUE NOT NULL,
CONTACT_DETAILS VARCHAR(100) NOT NULL,
BUDGET INT CHECK(BUDGET>0),
PRIMARY KEY (EVENT_NAME,EDITION)
);


CREATE TABLE sponsors(
COMPANY_NAME VARCHAR(30) PRIMARY KEY,
POC_NAME VARCHAR(30) NOT NULL,
POC_EMAIL VARCHAR(255) NOT NULL UNIQUE,
CONSTRAINT CheckEmailFormatSponsorsPoc CHECK (POC_EMAIL LIKE '%@%.%'),
POC_CONTACT_NO INT UNIQUE CHECK (POC_CONTACT_NO > 999999999 AND POC_CONTACT_NO < 10000000000),
COMPANY_MAIL VARCHAR(255) NOT NULL UNIQUE,
CONSTRAINT CheckEmailFormatSponsorsCompany CHECK (POC_EMAIL LIKE '%@%.%')
);

CREATE TABLE equipment(
EQUIPMENT_ID int  PRIMARY KEY check(EQUIPMENT_ID > 0),
NAME VARCHAR(30) NOT NULL,
QUANTITY INT NOT NULL CHECK(QUANTITY>0),
STATE VARCHAR(20) CHECK(STATE IN('GOOD','BAD')),
ACQUISITION_DATE DATE NOT NULL,
AVAILABILITY BOOLEAN NOT NULL,
IMG blob DEFAULT NULL
);

CREATE TABLE clubs(
CLUB_NAME VARCHAR(30) PRIMARY KEY,
DESCRIPTION VARCHAR(400) NOT NULL
);

CREATE TABLE council(
COUNCIL_NAME VARCHAR(30) PRIMARY KEY
);

CREATE TABLE CLUB_MEMBERS(
idx INT AUTO_INCREMENT PRIMARY KEY,
CLUBS_NAME VARCHAR(30) ,
ROLLS_NO INT ,
POSITION VARCHAR(30) CHECK(POSITION IN('SECRETARY','COORDINATOR','GENERAL MEMBER')),  
FOREIGN KEY (CLUBS_NAME) REFERENCES clubs(CLUB_NAME) ON DELETE CASCADE ON UPDATE CASCADE,    
FOREIGN KEY (ROLLS_NO)   REFERENCES students(ROLL_NO)  ON DELETE CASCADE ON UPDATE CASCADE
);



-- MANY-TO-MANY
CREATE TABLE PLACE_AND_TIME(
idx INT AUTO_INCREMENT PRIMARY KEY,
NAME VARCHAR(30),
EVENTS_NAME VARCHAR(20),
EDITIONS INT,
DATE DATE,

FOREIGN KEY (NAME) REFERENCES venue(ADDRESS) ON DELETE CASCADE ON UPDATE CASCADE,
FOREIGN KEY (EVENTS_NAME,EDITIONS) REFERENCES event(EVENT_NAME,EDITION) ON DELETE CASCADE ON UPDATE CASCADE
);

-- -- MANY-TO-MANY
CREATE TABLE OVERSEER(
EMPLOYEE_ID INT NOT NULL,
CLUB_NAME VARCHAR(30) NOT NULL,
FOREIGN KEY (CLUB_NAME) REFERENCES clubs(CLUB_NAME) ON DELETE CASCADE ON UPDATE CASCADE,
FOREIGN KEY (EMPLOYEE_ID) REFERENCES employee(EMPLOYEE_ID) ON DELETE CASCADE ON UPDATE CASCADE
);

-- MANY-TO-ONE from venue side
ALTER TABLE venue
ADD EMPLOYEE_ID INT NOT NULL;

ALTER TABLE venue
MODIFY EMPLOYEE_ID INT DEFAULT NULL;

ALTER TABLE venue
ADD CONSTRAINT IN_CHARGE FOREIGN KEY(EMPLOYEE_ID)
REFERENCES employee(EMPLOYEE_ID)
ON DELETE CASCADE ON UPDATE CASCADE;

-- MANY-TO-ONE From equipment side
CREATE TABLE ISSUE(
EQUIPMENT_ID INT NOT NULL,
ROLL_NO INT NOT NULL,
ISSUE_TIME DATETIME NOT NULL,
RETURN_TIME DATETIME ,
PURPOSE VARCHAR(50) ,

FOREIGN KEY (EQUIPMENT_ID) REFERENCES equipment(EQUIPMENT_ID) ,
FOREIGN KEY (ROLL_NO) REFERENCES students(ROLL_NO)
);

-- MANY-TO-MANY
CREATE TABLE COUNCIL_MEMBERS(
idx INT AUTO_INCREMENT PRIMARY KEY,
COUNCIL_NAME VARCHAR(100) ,
ROLLS_NO INT ,
POSITION VARCHAR(30) CHECK(POSITION IN('SECRETARY','COORDINATOR','GENERAL MEMBER')),  
FOREIGN KEY (COUNCIL_NAME) REFERENCES council(COUNCIL_NAME) ON DELETE CASCADE ON UPDATE CASCADE,    
FOREIGN KEY (ROLLS_NO)   REFERENCES students(ROLL_NO)  ON DELETE CASCADE ON UPDATE CASCADE
);

-- MANY-TO-MANY
CREATE TABLE SPONSORSHIP(
idx INT AUTO_INCREMENT PRIMARY KEY,
COMPANY_NAME VARCHAR(30) ,
EVENTS_NAME VARCHAR(20),
EDITIONS INT,

FOREIGN KEY (COMPANY_NAME) REFERENCES sponsors(COMPANY_NAME) ON DELETE CASCADE ON UPDATE CASCADE,
FOREIGN KEY (EVENTS_NAME,EDITIONS) REFERENCES event(EVENT_NAME,EDITION) ON DELETE CASCADE ON UPDATE CASCADE
);

-- MANY-TO-MANY With total participation from equipment side
CREATE TABLE OWNS(
EQUIPMENT_ID INT PRIMARY KEY,
CLUB_NAME VARCHAR(30) NOT NULL,

FOREIGN KEY (EQUIPMENT_ID) REFERENCES equipment(EQUIPMENT_ID) ON DELETE CASCADE ON UPDATE CASCADE ,
FOREIGN KEY (CLUB_NAME) REFERENCES clubs(CLUB_NAME) ON DELETE CASCADE ON UPDATE CASCADE
);

-- MANY-TO-MANY With total participation from event side
CREATE TABLE CONDUCTS(
CLUB_NAME VARCHAR(30) NOT NULL,
EVENTS_NAME VARCHAR(20),
EDITIONS INT,

FOREIGN KEY (EVENTS_NAME,EDITIONS) REFERENCES event(EVENT_NAME,EDITION) ON DELETE CASCADE ON UPDATE CASCADE,
FOREIGN KEY (CLUB_NAME) REFERENCES clubs(CLUB_NAME) ON DELETE CASCADE ON UPDATE CASCADE
);

-- MANY-TO-MANY With total participation from event side
CREATE TABLE ORGANIZERS(
EVENTS_NAME VARCHAR(20),
EDITIONS INT,
ROLL_NO INT NOT NULL,
RESPONSIBILITY VARCHAR(100) NOT NULL,

FOREIGN KEY (ROLL_NO)   REFERENCES students(ROLL_NO)  ON DELETE CASCADE ON UPDATE CASCADE,
FOREIGN KEY (EVENTS_NAME,EDITIONS) REFERENCES event(EVENT_NAME,EDITION) ON DELETE CASCADE ON UPDATE CASCADE
);


-- MANY-TO-MANY With total participation from event side
CREATE TABLE PARTICIPATION(
EVENTS_NAME VARCHAR(20),
EDITIONS INT,
ROLL_NO INT NOT NULL,
TEAM_NAME VARCHAR(20) NOT NULL,
TEAM_CAPTAIN BOOLEAN NOT NULL,

FOREIGN KEY (ROLL_NO)   REFERENCES students(ROLL_NO)  ON DELETE CASCADE ON UPDATE CASCADE,
FOREIGN KEY (EVENTS_NAME,EDITIONS) REFERENCES event(EVENT_NAME,EDITION) ON DELETE CASCADE ON UPDATE CASCADE
);


-- MNAY-TO-ONE From CLUB side
ALTER TABLE clubs
ADD COLUMN COUNCIL_NAME VARCHAR(30);


ALTER TABLE clubs
ADD FOREIGN KEY (COUNCIL_NAME) REFERENCES council(COUNCIL_NAME);


-- MANY-TO-ONE from event side with total participation from event side
CREATE TABLE APPROVAL(
EVENT_NAME VARCHAR(20),
EDITION INT,
EMPLOYEE_ID INT NOT NULL,

PRIMARY KEY (EVENT_NAME,EDITION),
FOREIGN KEY (EVENT_NAME,EDITION) REFERENCES event(EVENT_NAME,EDITION) ON DELETE CASCADE ON UPDATE CASCADE,
FOREIGN KEY (EMPLOYEE_ID) REFERENCES employee(EMPLOYEE_ID) ON DELETE CASCADE ON UPDATE CASCADE
);



