-- -- INSERTING CLUBS DATA
INSERT INTO clubs VALUES('Palette', 'The club aim is to promote all forms of art in college and to provide students with equal opportunity to enhance as well as showcase their talent in art by the means of the workshop and annual exhibitions.', 'Cultural Council') , ('Sargam', 'The music club at IITGN gives the community an opportunity to be a part of different bands within the institute and to perform at different cultural events. The club appreciates and promotes various genres of music.', 'Cultural Council') , ('Step-Up', 'The club aim is to encourage students to take up different dance forms and provide a platform to perform these styles collectively. The Dance Club organizes expert and beginner level workshops for students, faculty and staff of the institute.', 'Cultural Council') , ('Digis', 'Dice is the digital sports development club of IIT Gandhinagar. It acts as a platform for creative thinkers to turn their imaginations into reality. The club intends to take human-technology interaction to a whole new level.', 'Technical Council') , ('Abhinaya', 'Abhinaya, the drama club at IITGN, brings together all the acting and theatre enthusiasts to experience the theatre environment from script writing to acting. The drama club is actively engaged in making short films.', 'Cultural Council') , ('Odyssey', 'The Odyssey club of IITGN attempts to foster the knowledge and participation of students of the institute in the field of astronomy. The club provides students with technical learning and hands on experiences on astronomical equipments.', 'Technical Council') , ('LDI', 'LDI is to promote leadership skills among the IITGN student community through experiential learning and engaging activities. It believe in going beyond monotonous talks and instead focus on active involvement.', null) , ('Coding Initiative', 'Coding initiative aims to inculcate among students the skills of problem solving through programming and coding.', NULL) , ('Art@IITGN', 'This is an initiative that promotes and facilitates artistic expressions and engagements on campus. Art as a medium and practice nurtures liberal, inclusive, interdisciplinary, and futuristic values.', null) , ('Annuity', 'Financial Club', 'PDC') , ('Cinematheque', 'Film-screening club', 'Cultural Council') , ('LitSoc', 'Club to promote skills related to literary arts', 'Cultural Council') , ('Chess Club', 'Promotes chess culture in college', 'Sports Council') , ('16Pixels', 'Photography club', 'Cultural Council') , ('Mean Mechanics', 'Robotics club', 'Technical Council') , ('Grasp', 'Competitive coding club of the college', 'Technical Council') , ('Quizzing Society', 'Club which promotes quizzing culture and skills among community', 'Cultural Council') , ('Metis', 'Web and app development club', 'Technical Council') , ('Anveshanam', 'Research society of college which promotes field of research', NULL) ;
