select s.COMPANY_NAME, COMPANY_MAIL, 
	(case when SPONSORSHIP_AMT>20000 then 'Gold'
    when SPONSORSHIP_AMT between 10000 and 20000 then 'Silver'
    else 'regular' end) as CATEGORY,
    count(*) as Events_sponsored 
from SPONSORSHIP as s 
join EVENT as e on e.EVENT_NAME=S.EVENTS_NAME and e.EDITION=s.EDITIONS
left join sponsors as sp on sp.COMPANY_NAME = s.COMPANY_NAME
where e.BUDGET>0
group by s.COMPANY_NAME,COMPANY_MAIL,CATEGORY;

select EVENT_NAME, avg(BUDGET) as Avg_Budget_for_different_ed
from EVENT
group by EVENT_NAME;

